import React from "react";
import Dashboard from "../assets/img/dashboard.svg"
import Orders from '@material-ui/icons/Assignment';
import Purchase from '@material-ui/icons/LocalMallOutlined';
import Inventory from '@material-ui/icons/AcUnitOutlined';
import Customer from '@material-ui/icons/PersonOutlineOutlined';
import Supplier from '@material-ui/icons/ShoppingCartOutlined';
import Tools from '@material-ui/icons/BuildOutlined';
import Reports from '@material-ui/icons/Assessment';
import Staff  from '@material-ui/icons/AccountBox';
import Mail from '@material-ui/icons/MailOutline';
import Location from '@material-ui/icons/LocationOn';

export const SidebarData = [
    {
        title: "Dashboard",
        icons : <Dashboard />,
        link : "/dashboard"
    },
    {
        title: "Customer Quotes & Orders",
        icons : <Orders/>,
        link : "/orders"
    },

    {
        title: "Purchase Orders",
        icons : <Purchase />,
        link : "/purchase"
    },
    {
        title: "Inventory Management",
        icons : <Inventory />,
        link : "/inventory"
    },
    {
        title: "Customer Management",
        icons : <Customer />,
        link : "/customer"
    },
    {
        title: "Supplier Management",
        icons : <Supplier />,
        link : "/supplier"
    },
    {
        title: "Tools & Settings",
        icons : <Tools/>,
        link : "/settings"
    },
    {
        title: "Reports",
        icons : <Reports />,
        link : "/reports"
    },
    {
        title: "Staff Directory",
        icons : <Staff />,
        link : "/staff"
    },
    {
        title: "Message Center",
        icons : <Mail />,
        link : "/mail"
    },
    {
        title: "Map Locator",
        icons : <Location/>,
        link : "/location"
    },

]
